import { MapLayOut } from "features/map/index";
import React from "react";

import { LocalMap, LocalMapInfo, Options } from "features/map/components";

const LocalMapPage = () => {

    return (<>
    <MapLayOut>
        <div>
            <Options/>
            <LocalMap/>
            <LocalMapInfo/>
        </div>
    </MapLayOut>
    </>);
};

export default LocalMapPage;
